const Input = ({title, sample, name, type}) => {
    return(
        <div className='inputDiv'>
            <label className='inputTitle' for="email">School Email</label><br />
            <input className='Input' type="email" placeholder="astronomy@gmail.com" id="email" name="email"/>
        </div>
    )
}

export default Input;
